const init = {
    menuSelected: "home"
};

export default (state=init, action) => {
    console.log(action.payload);
    switch (action.type) {
        case 'ON_MENU_CHANGE':
            console.log({...state, menuSelected: action.payload})
            return {...state, menuSelected: action.payload};

        default:
            return {...state};
    }
}
